script: |
  super -f text -I q735.spq | sort > q735.out

inputs:
  - name: q735.spq
    data: |
      SELECT DISTINCT - + col0 + - 59 + - col0 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE NOT ( col0 * - CAST ( NULL AS INTEGER ) - - + col0 ) NOT IN ( + col2 + - col1 - col1, + col1, col0 * - col1 * - 96 );
  - name: tab1

outputs:
  - name: q735.out
    data: |
